import React from 'react';
import Card from "./Card";
import Sdata from "./SkillData";
const Skills = () => {
    return (
        <>
            <div className="my-5">
                <h1 className="text-center">Skills</h1>
            </div>
            <div className="container-fluid  mb-5 align-items-stretch">
                <div className="row ">
                    <div className="col-10 mx-auto">
                        <div className="row gy-4">
                            {
                                Sdata.map((val, ind) => {
                                    return <Card key={ind}
                                        imgsrc={val.imgsrc}
                                        title={val.title}
                                    />
                                })
                            }


                        </div>
                    </div>
                </div>
            </div>

        </>
    )
}
export default Skills;
